create table movies (
	id VARCHAR(40) NOT NULL PRIMARY KEY,
	title VARCHAR(50) NOT NULL,
	movie_description VARCHAR(500) NOT NULL,
	release_date DATE,
	budget DECIMAL(15,2),
	country VARCHAR(50),
	production_companies VARCHAR(18),
	actors VARCHAR(17),
	director VARCHAR(17),
	writers VARCHAR(15),
	ratings DECIMAL(3,1),
	duration INT,
	genre VARCHAR(50),
	poster_image VARCHAR(27),
	created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
	updated_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP,
);
